attributes.style:
#%(id)s caption
{

}

#%(id)s table.table
{
	border-collapse:collapse;
	border: none;
	height: 0;

}

#%(id)s .thead
{
	font-size:12px;
	text-align:left;
	padding:0 8px;
	line-height: 16px;
}

#%(id)s .thead:hover
{
	color: #BD202F;
	background: #fafafa !important;
}

#%(id)s .th-cell
{
	border: none;
	padding-left:6px;
	font-size:12px;
}

#%(id)s th.th-cell-0, #%(id)s td.cell-0 input
{
	width: 18px;
	margin: 2px;
}

#%(id)s table.table td.cell
{
	border: none;
	padding-left:6px;
	text-align:left;

}


#%(id)s table.table td.cell:hover
{
	color: #BD202F;
}

#%(id)s tr.even
{

}

#%(id)s .row
{

}

#%(id)s .row:hover
{
	background: #fafafa !important;
}

#%(id)s .row_selected
{
	background:#f2f2f2!important;
	color: #BD202F;
}
